__ht__function(json, dm, gv, datas) {gv.setMovableFunc(function(data) { return false });     // 禁止图元移动
gv.getSelectWidth = function() {return 0};    // 去掉选中外边框
// 更新当前时间
function updateDateTime() {	
	var titleDate = dm.getDataByTag('fTitleDate');   // 科幻日期
	var titleTime = dm.getDataByTag('fTitleTime');   // 科幻时间
    var now = new Date();
    var year = now.getFullYear();    // 得到年份
    var month = now.getMonth();      // 得到月份
    var date = now.getDate();        // 得到日期
    var hour = now.getHours();       // 得到小时
    var minu = now.getMinutes();     // 得到分钟
    var sec = now.getSeconds();      // 得到秒
    month = month + 1;
    if (month < 10) month = '0' + month;
    if (date < 10) date = '0' + date;
    if (hour < 10) hour = '0' + hour;
    if (minu < 10) minu = '0' + minu;
    if (sec < 10) sec = '0' + sec;
    var currentTime = '';
	var currentDate = '';					  
	currentTime = hour + ':' + minu + ':' + sec;
	currentDate = year + '年' + month + '月' + date +'日';
	titleDate.s('text', currentDate);	// 设置当前日期	科幻
	titleTime.s('text', currentTime);	// 设置当前时间	科幻
};
setInterval(updateDateTime, 1000);

numTask = {
	interval: 1000,
	min: 1,
	max: 80,
	num: 2,
	speed: 0.05,
	action: function(data){							
		this.num = this.num + this.speed;
        var tag = data.getTag();
        if(tag) {
            if(tag.startsWith('fInstantFlow') || tag.startsWith('fInstantHeat') || tag.startsWith('fProvidePre') || tag.startsWith('fReturnPre') || tag.startsWith('fFliterPre')) {  //流量  热量 水压力 过滤器压力
                data.a('value', this.num.toFixed(1));
            } else if (tag.startsWith('fValve') || tag.startsWith('fCycle') || tag.startsWith('fAdd') || tag.startsWith('fProvideTem') || tag.startsWith('fReturnTem') || tag.startsWith('fCollectValue')) {  // 阀门开启度 循环泵补水泵频率 水温  集水箱
                data.a('value', (this.num + 8).toFixed(1));
            } 
        } 
		if(this.num >= this.max) {
			this.num = this.min;
		}
	}        
};
dm.addScheduleTask(numTask);      // 数字

var handBtn = dm.getDataByTag('fHandBtn');        // 科幻手动按钮默认模式
handBtn.a('mode', true);

dm.getDataByTag('fAddPump1').a('running', true);   // 科幻默认状态开
dm.getDataByTag('fAddPump2').a('running', true);
dm.getDataByTag('fCycPump1').a('running', true);
dm.getDataByTag('fCycPump2').a('running', true);

fanTasks = {
	interval: 50,
	speed: Math.PI / 100,
	num: 0,
	action: function (data) {							
        var tag = data.getTag();						
		this.num = this.num + this.speed;
        if(tag) {
            if (tag.startsWith('fAddPump') || tag.startsWith('fCycPump')) {     // 补水泵1/2   循环泵1/2   
                if(data.a('running')) {
		        	data.a('rotation', this.num);
		        }
            } 
            if(this.num >= 2000) {
                this.num = 0;
            }
        }
	}        
}; 
dm.addScheduleTask(fanTasks);       // 扇叶

//耗能排名部分 及深井泵
function animConsume() {
	ht.Default.startAnim({
		duration: 6000,
		easing: function (t) { return t * t },
		deepDump: dm.getDataByTag('fDeepDump'),         // 科幻深井泵
		action: function (v, t) {
			var comInfo = dm.getDataByTag('fComInfo');
			var num = 0;
			for(var i = 0; i < 3; i++) {
				comInfo.a('progress' + i, num + (1 - num) * v);	// 科幻耗能进度条
			}
			comInfo.a('water', (num + (260 - num) * v).toFixed(1));	
			comInfo.a('elec', (num + (860 - num) * v).toFixed(1));	
			comInfo.a('heat', (num + (630 - num) * v).toFixed(1));
			this.deepDump.a('progress', num + (1 - num) * v);     // 科幻深井泵  
		},
		finishFunc: function () {
			animConsume();
		}
	});
}
animConsume();

//故障统计  旋转
function animFault() {
	ht.Default.startAnim({
		duration: 1000,
		easing: function (t) { return t },
		rotateTime: dm.getDataByTag('fRotation'),   // 科幻时间
		numRotation: 0,
		action: function (v, t) {
			// 故障统计
			var comInfo = dm.getDataByTag('fComInfo');
			var num = 0;
			for(var i = 0; i < 10; i++) {
				comInfo.a('equ' + i, num + (1 - num) * v);
			}
			// 圆圈
			this.rotateTime.setRotation(this.numRotation + (Math.PI * 2 - this.numRotation) * v);
		},
		finishFunc: function () {
			animFault();
		}
	});
}
animFault();

// 科幻流动
function animFlow() {
	ht.Default.startAnim({
		duration: 20000,
		easing: function (t) { return t },
		speed: 0.5,
		numLeft: 0,
		numRight: 0,
		action: function (v, t) {
            var addText = [];
            var flowAdd = [];
            for(var i = 0; i < 3; i++) {
                addText.push('flowAdd' + i);
                flowAdd.push(dm.getDataByTag(addText[i]));
            }
            var reduceText = [];
            var flowReduce = [];
            for(var i = 0; i < 9; i++) {
                reduceText.push('flowReduce' + i);
                flowReduce.push(dm.getDataByTag(reduceText[i]));
            }
            for(var n = 0; n < flowReduce.length; n++){
                flowReduce[n].s('shape.dash.offset', -1000 + (0 + 1000) * v);
            }
            for(var n = 0; n < flowAdd.length; n++){
                flowAdd[n].s('shape.dash.offset', 0 + (1000 - 0) * v);
            }
		},
		finishFunc: function () {
			animFlow();
		}
	});
}
animFlow();


// 数据报表   
function dataReport() {
	var comInfo = dm.getDataByTag('fComInfo');	
	var x = 211.22065;
	var step = 35.5;
	var tn = setInterval(function () {
		comInfo.a('pos', [x, 721.61356, 0.59002, 129.42319]);
		if (x >= 388.72065) {
			x = 68.44788;
		}
		x = x + step;
		var randomNum = Math.floor(Math.random() * (1600 - 1000 + 1) + 1000);    // 热量随机数(1000-1600)
		comInfo.a('valueH', randomNum);
		comInfo.a('valueL', randomNum - 10);
	}, 500);
}
dataReport();

function water() {
	ht.Default.startAnim({
		duration: 5000,
		easing: function (t) { return t },
		addWater: dm.getDataByTag('fAddWater'),       	// 科幻补水箱
		waterValue: dm.getDataByTag('fWaterValue'),   	// 科幻补水箱数字
		num: 0,
		action: function (v, t) {
			this.addWater.a('progress', this.num + (1 - this.num) * v);
			this.waterValue.a('value', (this.num + (99 - this.num) * v).toFixed(1));
		},
		finishFunc: function () {
			water();
		}
	});
}
water();}

